// ==UserScript==
// @name         Curseforge Direct Downloader
// @namespace    http://blockbuster.xp3.biz/
// @version      1.1
// @description  Simply appends '/file' to of every Minecraft Curseforge download link.
// @author       Theblockbuster1
// @match        https://www.curseforge.com/minecraft/mc-mods*
// @match        https://www.curseforge.com/minecraft/texture-packs*
// @match        https://www.curseforge.com/minecraft/worlds*
// @match        https://www.curseforge.com/minecraft/mc-addons*
// @match        https://www.curseforge.com/minecraft/customization*
// @match        https://www.curseforge.com/minecraft/bukkit-plugins*
// @match        https://www.curseforge.com/minecraft/modpacks*
// @icon         data:image/png;base64,
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/394179/Curseforge%20Direct%20Downloader.user.js
// @updateURL https://update.greasyfork.org/scripts/394179/Curseforge%20Direct%20Downloader.meta.js
// ==/UserScript==

$("[href]").each(function() {
    if ($(this).attr("href").slice(-16, -8) == "download") {
        $(this).attr("href", $(this).attr("href") + "/file");
    } else if ($(this).attr("href").endsWith("download")) {
        const that = this;
        fetch($(this).attr("href"))
            .then(function(res) {
                return res.text();
            })
            .then(function(html) {
                let parser = new DOMParser();
                let page = parser.parseFromString(html, "text/html");
                $(that).attr("href", page.getElementsByClassName("alink")[0].getAttribute("href"));
            })
            .catch(function(e) {
                console.error(e);
            });
    }
});